import logo from "./logo.svg";
import "./App.css";
import Home from "./Component/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
        <Home />
        <Routes>
          <Route path=""></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
